import React, { Component } from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import "../Inthewomb/Slick.css";
import week_1_pregnant from "../images/Pregnancy by week/1-week-pregnant.png";
import week_2_pregnant from "../images/Pregnancy by week/2-week-pregnant.png";
import week_3_pregnant from "../images/Pregnancy by week/3-week-pregnant.png";
import week_4_pregnant from "../images/Pregnancy by week/4-week-pregnant.png";
import week_5_pregnant from "../images/Pregnancy by week/5-week-pregnant.png";
import week_6_pregnant from "../images/Pregnancy by week/6-week-pregnant.png";
import week_7_pregnant from "../images/Pregnancy by week/7-week-pregnant.png";
import week_8_pregnant from "../images/Pregnancy by week/8-week-pregnant.png";
import week_9_pregnant from "../images/Pregnancy by week/9-week-pregnant.png";
import week_10_pregnant from "../images/Pregnancy by week/10-week-pregnant.png";
import week_11_pregnant from "../images/Pregnancy by week/11-week-pregnant.png";
import week_12_pregnant from "../images/Pregnancy by week/12-week-pregnant.png";
import week_13_pregnant from "../images/Pregnancy by week/13-week-pregnant.png";

export default class CenterMode extends Component {
  render() {
    const settings = {
      className: "center",
      centerMode: true,
      infinite: true,
      centerPadding: "60px",
      slidesToShow: 3,
      speed: 500
    };
      return (
        <div>
          <Slider {...settings}>

            <div>

            <img src={week_1_pregnant} alt="logo" width="200" height="200"/><h className="byweek">Week 1</h>
            </div>
            <div>

            <img src={week_2_pregnant} alt="logo" width="200" height="200"/><h className="byweek">Week 2</h>
            </div>
            <div>
            <img src={week_3_pregnant} alt="logo" width="200" height="200"/><h className="byweek">Week 3</h>
            </div>
            <div>
            <img src={week_4_pregnant} alt="logo" width="200" height="200"/><h className="byweek">Week 4</h>
            </div>
            <div>
            <img src={week_5_pregnant} alt="logo" width="200" height="200"/><h className="byweek">Week 5</h>
            </div>
            <div>
            <img src={week_6_pregnant} alt="logo" width="200" height="200"/><h className="byweek">Week 6</h>
            </div>
            <div>
            <img src={week_7_pregnant} alt="logo" width="200" height="200"/><h className="byweek">Week 7</h>
            </div>
            <div>
            <img src={week_8_pregnant} alt="logo" width="200" height="200"/><h className="byweek">Week 8</h>
            </div>
            <div>
            <img src={week_9_pregnant} alt="logo" width="200" height="200"/><h className="byweek">Week 9</h>
            </div>
            <div>
            <img src={week_10_pregnant} alt="logo" width="200" height="200"/><h className="byweek">Week 10</h>
            </div>
            <div>
            <img src={week_11_pregnant} alt="logo" width="200" height="200"/><h className="byweek">Week 11</h>
            </div>
            <div>
            <img src={week_12_pregnant} alt="logo" width="200" height="200"/><h className="byweek">Week 12</h>
            </div>
            <div>
            <img src={week_13_pregnant} alt="logo" width="200" height="200"/><h className="byweek">Week 13</h>
            </div>


          </Slider>
        </div>
      );
    }
  }
